@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM a owl:Class .
atm:Transaction a owl:Class .
atm:TransactionStatus a owl:Class .

atm:hasTransaction a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Transaction .

atm:hasStatus a owl:ObjectProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range atm:TransactionStatus .

atm:TransactionFailed a atm:TransactionStatus .

atm:sends a owl:DatatypeProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range xsd:string .

atm:Transaction a owl:Class ;
  rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:hasStatus ;
    owl:someValuesFrom atm:TransactionFailed
  ] .

atm:ATM a owl:Class ;
  rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:sends ;
    owl:hasValue "transaction failed"
  ] .
